BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "hebergements" (
	"id"	INTEGER,
	"type"	varchar(15),
	"nom"	varchar(100),
	"adresse"	varchar(200),
	"code"	varchar(6),
	"cout"	REAL,
	FOREIGN KEY("code") REFERENCES "villes"("code"),
	PRIMARY KEY("id")
);
CREATE TABLE IF NOT EXISTS "comptes" (
	"login"	varchar(8),
	"mdp"	varchar(128),
	"role"	varchar(15) NOT NULL,
	PRIMARY KEY("login")
);
CREATE TABLE IF NOT EXISTS "enseignants" (
	"secu"	varchar(15),
	"nom"	varchar(50) NOT NULL,
	"prenom"	varchar(50) NOT NULL,
	"naissance"	date,
	"email"	varchar(100) NOT NULL UNIQUE,
	"tel"	varchar(10),
	"urgence"	varchar(100),
	"login"	varchar(8),
	FOREIGN KEY("login") REFERENCES "comptes"("login"),
	PRIMARY KEY("secu")
);
CREATE TABLE IF NOT EXISTS "missions" (
	"id"	INTEGER,
	"motif"	varchar(100) NOT NULL,
	"code"	varchar(6) NOT NULL UNIQUE,
	"debut"	date NOT NULL,
	"fin"	date NOT NULL,
	"etat"	varchar(10),
	"secu"	varchar(15),
	"id_aller"	INTEGER,
	"id_retour"	INTEGER,
	"id_hebergement"	INTEGER,
	"repas"	INTEGER,
	FOREIGN KEY("code") REFERENCES "villes"("code"),
	FOREIGN KEY("id_retour") REFERENCES "transports"("id"),
	PRIMARY KEY("id"),
	FOREIGN KEY("id_hebergement") REFERENCES "hebergements"("id"),
	FOREIGN KEY("secu") REFERENCES "enseignants"("secu"),
	FOREIGN KEY("id_aller") REFERENCES "transports"("id")
);
CREATE TABLE IF NOT EXISTS "depenses" (
	"id"	INTEGER,
	"id_mission"	INTEGER,
	"nature"	varchar(150),
	"cout"	REAL,
	PRIMARY KEY("id"),
	FOREIGN KEY("id_mission") REFERENCES "missions"("id")
);
CREATE TABLE IF NOT EXISTS "villes" (
	"code"	varchar(6),
	"ville"	varchar(100) NOT NULL,
	"postal"	varchar(6),
	"gps"	varchar(100),
	PRIMARY KEY("code")
);
CREATE TABLE IF NOT EXISTS "transports" (
	"id"	INTEGER,
	"type"	varchar(25),
	"debut"	date,
	"numero"	varchar(20) NOT NULL UNIQUE,
	"cout"	REAL,
	PRIMARY KEY("id" AUTOINCREMENT)
);
COMMIT;
